                    <!-- Right Content -->
                    <div class="col-lg-6 col-md-12 about-text ps-lg-5">
                        <h3 class="theme-heading mb-3">About Chemist Near Me</h3>
                        <p class="about-sub-title theme-paragraph text-justify mb-lg-3 mb-3 ">
                            At Chemist Near Me, we believe in empowering our patients with valuable healthcare advice to
                            support their well-being. Our team is dedicated to providing essential tips endorsed by the
                            NHS
                            for maintaining optimal health, such as maintaining a balanced
                            diet, staying physically active, managing stress, and getting enough sleep. Additionally, we
                            offer lesser-known yet impactful advice that can make a significant difference in overall
                            health. For instance, recent studies have shown
                            that spending time in nature, known as "forest bathing," can reduce stress levels, boost
                            immunity, and improve mood.
                        </p>

